import React, { Component } from 'react'

export default class searches extends Component {
    constructor(props){
        super(props)
        this.state = {
            data : []
        }
    }

    redirect = () => {
        console.log("wow")
        this.props.history.push("../")
    }

    render() {
        return (
            <div>
                <button id="mainpage" onClick={()=>this.redirect()}>Back to Main Page</button>
                <div>
                    <input id="idsearch" placeholder="search by ID"></input>
                    <button className="searchbtn">search by ID</button>
                    <p1>Or</p1>
                    <input id="valuesearch" placeholder="search by value"></input>
                    <button className="searchbtn">search by value</button>
                </div>
                <table>
             <tr>
               <th>date</th>
               <th>open</th>
               <th>high</th>
               <th>low</th>
               <th>close</th>
               <th>volume</th>
               <th>value</th>
             </tr>
             {this.state.data.map((data)=>{
               return(
                 <tr>
                <td>{data.date}</td>
                <td>{data.open}</td>
                <td>{data.high}</td>
                <td>{data.low}</td>
                <td>{data.close}</td>
                <td>{data.volume}</td>
                <td>{data.value}</td>
                 </tr>

               )
             })}
           </table>
            </div>
        )
    }
}
